window.bookSummaryJSON = "<p>The New York Times best seller.</p> <p>There are a few unbreakable rules in the game.</p> <p>Stay collected. Compartmentalize. Think your next move through.</p> <p>Never let your heart dictate your tactics.</p> <p>The heart is impulsive.</p> <p>The heart makes bad decisions.</p> <p>The heart doesn’t see the long game.</p> <p>The heart may have decided to get Adam back, but when the endgame comes, the heart’s going to be the one to break.</p>"; 
